import React from 'react';
import './App.css';
import SignUp from './components/'

import {BrowserRouter, Route, Switch} from 'react-router-dom'

const App = () => {
  return (
    <BrowserRouter>
      <div>

       <Route path="/signup" component = {SignUp} />
      </div>
    </BrowserRouter>

  );
}

export default App;
